description:
Verenigde Staten
Horror

geregisseerd door Lance W. Dreesen
met Kimberly Brown, Trevor Duke en Richard Tyson

Eerstejaars student Derek wordt door zijn klasgenoten gedwongen om een feestje te organiseren in het huis van zijn stiefvader. Daar aangekomen worden zijn klasgenoten aangevallen en vermoord door een weerwolf. Derek vermoedt dat zijn aan alcohol verslaafde stiefvader hier iets mee te maken heeft.


